import React from 'react'
import { NavLink } from 'react-router-dom'
import { Menu } from 'antd';
import store from "../redux/store"
import { createFetchMenu } from "../redux/count_aciton"

function Side() {
    const onClick = (e) => {
        store.dispatch(createFetchMenu(e.key))
    };
    return (
        <Menu
            onClick={onClick}
            style={{
                width: 200,
                height: '80vh',
            }}
            mode="inline"
            theme='dark'
        >
            <Menu.Item key='jobManagemen'>
                <NavLink activeClassName='active' className='list-group-item' to='/dashboard/jobManagemen'>作业管理</NavLink>
            </Menu.Item>
            <Menu.Item key='explorationProject'>
                <NavLink activeClassName='active' className='list-group-item' end to='/dashboard/explorationProject'>勘探项目</NavLink>
            </Menu.Item>
        </Menu>
    )
}
export default Side
